import '../Styles/Banner_space.css'
import Landscape from "../Assets/landscape.png"

function Banner (){
    return (
        <div className="Banner">
            <img src={Landscape} alt="Landscape">Chez vous partout, et ailleurs</img>
        </div>
    )

}

export default Banner
